type props = {
    placer: String,
    typed: String,
    id: String,
    name: String,
}

const SmallInput = ({
    placer,
    typed,
    id,
    name,
}: props) => {
    return (
    <div className="flex flex-col space-y-1">
        {/* <placer className="text-sm text-gray-400">
            {placer}:
        </placer> */}
        <Field id={String(id)}
               name={String(name)}
               placeholder={String(placer)}
               type={String(typed)} 
               className="border-b-2
                          border-blue-800 
                          text-lg
                          h-12 
                          outline-none 
                          px-4
                          w-36 
                          hover:shadow-xl
        "/>
    </div>
    )
}

export default SmallInput
